void addGroupToEmpl()
{
    ProjValEmplProjTable    locProjValEmplProjTable;
    container               data;

    locProjValEmplProjTable = projValEmplProjTable_NotGroup_DS.getFirst(1);

    if (!locProjValEmplProjTable)
    {
        data += projValEmplProjTable_NotGroup.GroupId;
    }
    else
    {
        while (locProjValEmplProjTable)
        {
            data += locProjValEmplProjTable.GroupId;
            locProjValEmplProjTable = projValEmplProjTable_NotGroup_DS.getNext();
        }
    }

    ProjValGroupServer::addEmplProjGroupToResource(data, resourceRecId);
}

void addProjToEmpl()
{
    ProjTable   locProjTable;
    container   data;
    DataAreaId  dataAreaId;

    locProjTable = projTable_NotEmpl_DS.getFirst(1);

    if (!locProjTable)
    {
        data += projTable_NotEmpl.ProjId;
        dataAreaId = projTable_NotEmpl.DataAreaId;
    }
    else
    {
        while (locProjTable)
        {
            data += locProjTable.ProjId;
            dataAreaId = locProjTable.DataAreaId;
            locProjTable = projTable_NotEmpl_DS.getNext();
        }
    }

    using (ProjValEmplProjSetupParameters insertParameters = ProjValEmplProjSetupParameters::parmDataAreaId(dataAreaId))
    {
        ProjValElementServer::addProjToResource(data, resourceRecId);
    }
}

void buildQuery()
{
    str                     groupStr;
    ProjValEmplProjSetup    setupTbl;

    // Build a filtering condition based on all the groupID associated to the Employee in ProjValEmplProjSetup table
    if (resourceRecId)
    {
        while select crossCompany GroupId from setupTbl
            group by GroupId
            where setupTbl.Resource == resourceRecId &&
                  setupTbl.GroupId
        {
            if (!groupStr)
            {
                groupStr = strFmt(
                        '((%1.%2 == "%3") && (%1.%4 == 0))',
                        qbd.name(),
                        fieldStr(ProjValEmplProjSetup, GroupId),
                        queryValue(setupTbl.GroupId),
                        fieldStr(ProjValEmplProjSetup, Resource));
            }
            else
            {
                groupStr += strFmt(
                        ' || ((%1.%2 == "%3") && (%1.%4 == 0))',
                        qbd.name(),
                        fieldStr(ProjValEmplProjSetup, GroupId),
                        queryValue(setupTbl.GroupId),
                        fieldStr(ProjValEmplProjSetup, Resource));
            }
        }

        if (!groupStr)
        {
            groupStr = strFmt(
                    '((%1.%2 == %3) && (%1.%4 == ""))',
                    qbd.name(),
                    fieldStr(ProjValEmplProjSetup, Resource),
                    queryValue(resourceRecId),
                    fieldStr(ProjValEmplProjSetup, GroupId));
        }
        else
        {
            groupStr += strFmt(
                    '|| ((%1.%2 == %3) && (%1.%4 == ""))',
                    qbd.name(),
                    fieldStr(ProjValEmplProjSetup, Resource),
                    queryValue(resourceRecId),
                    fieldStr(ProjValEmplProjSetup, GroupId));
        }
    }

    if (groupStr)
    {
        list_GroupId.value(groupStr);
    }
    else
    {
        list_GroupId.value(SysQuery::valueEmptyString());
    }
}

