public void init()
{    
    Query                q;
    QueryBuildDataSource qbr1;
    QueryBuildDataSource qbr2;

    q = new Query();

    super();

    qbr1 = q.addDataSource(tableNum(ProjTable));

    if (!ProjMultipleContractLinesForProjectFeatureHelper::isFeatureEnabled())
    {
        qbr1.addRange(fieldNum(ProjTable, Type)).value(queryValue(ProjType::TimeMaterial));
        qbr1.addRange(fieldNum(ProjTable, Type)).value(queryValue(ProjType::FixedPrice));
        qbr1.addRange(fieldNum(ProjTable, Type)).value(queryValue(ProjType::Internal));
        qbr1.addRange(fieldNum(ProjTable, Type)).value(queryValue(ProjType::Cost));
        qbr1.addRange(fieldNum(ProjTable, Type)).value(queryValue(ProjType::Investment));
        qbr1.addRange(fieldNum(ProjTable, Type)).value(queryValue(ProjType::Time));
    }

    if (ProjCDSLockingOptionTable::get(ProjCDSLockingOption::ProjectResourcing))
    {
        qbr1.addRange(fieldNum(ProjTable, ProjDataSource)).value(SysQuery::value(0));
    }

    qbr2 = qbr1.addDataSource(tableNum(ProjValEmplProjSetup));

    qbr2.relations(true);
    qbr2.joinMode(JoinMode::NoExistsJoin);
    qbr2.addSortField(fieldNum(ProjValEmplProjSetup, GroupId));
    qbr2.addRange(fieldNum(ProjValEmplProjSetup, GroupId)).value(SysQuery::valueEmptyString());

    notElement_EmplId = qbr2.addRange(fieldNum(ProjValEmplProjSetup, Resource));         

    this.query(q);
    this.setDataArea();
}

