public void setDataArea()
{
    DataAreaId dataArea = companyLookup.text() == '' ? curExt() : companyLookup.text();
    dataArea = dataArea == '' ? curExt() : dataArea;
    this.query().dataSourceTable(tableNum(ProjTable)).company(dataArea);
    SysQuery::findOrCreateRange(this.query().dataSourceTable(tableNum(ProjTable)), fieldNum(ProjTable, DataAreaId)).value(dataArea);
}

public void executeQuery()
{
    DataAreaId dataArea = companyLookup.text() == '' ? curExt() : companyLookup.text();
    dataArea = dataArea == '' ? curExt() : dataArea;
    changecompany(dataArea)
    {
        super();
    }
}

